import React, { useState } from 'react'
import PropTypes from 'prop-types'

export default function Navbar(prop) {
  const [mode, setMode] = useState('Dark Mode');

  const [mystyle, setMystyle] = useState({
    color: 'rgb(200, 195, 195)',
    backgroundColor: 'rgb(21, 20, 20)'
  })
  const [mystyle2, setMystyle2] = useState({
    color: 'rgb(200, 195, 195)'
  })

  const onhandlechange = () => {
    if (mystyle.backgroundColor === 'rgb(21, 20, 20)') {
      document.body.style.color = 'white'
      document.body.style.backgroundColor = 'black'
      setMystyle({
        color: 'black',
        backgroundColor: 'white'
      })
      setMystyle2({
        color: 'black'
      })
      setMode('Light mode')


    }
    else {
      document.body.style.color = 'black'
      document.body.style.backgroundColor = 'white'
      setMystyle({
        backgroundColor: 'rgb(21, 20, 20)',
        color: 'white',
      })
      setMystyle2({
        color: 'white'
      })
      setMode('Dark mode')
    }
  }
  return (
    <nav className="topic" id="toipc">
      <ul className="topicinside" id="topicinside" style={mystyle}>
        <li className="nametopic"><a href="/" style={mystyle2}>Home</a></li>
        <li className="nametopic"><a href="/" style={mystyle2}>{prop.method} method</a></li>
        <li className="nametopic" id="nametopic3"><a href="/" style={mystyle2}>{prop.title}</a></li>
        <li className="nametopic"><a href="/" style={mystyle2}>{prop.Array}</a></li>
        <li className="nametopic"><a href="/" style={mystyle2}>Help</a></li>
        <li className="nametopic"><div class="form-check form-switch">
          <input class="form-check-input" type="checkbox" role="switch" id="flexSwitchCheckDefault"/>
            <label className="form-check-label " htmlFor="flexSwitchCheckDefault">Dark MOde</label>
        </div></li>
      </ul>
    </nav>
  )
}
Navbar.propTypes = {
  title: PropTypes.string.isRequired,
  method: PropTypes.string.isRequired,
  Array: PropTypes.string.isRequired,

}
Navbar.defaultProps = {
  method: "string method",
  title: "Texutils",
  Array: "Array method",
}
